import React, { Component } from "react";

class BookmarkContainer extends Component {
  constructor() {
    super();
    this.state = {
      name: "Profile"
    };
  }

  render() {
    return (
        <div className="profile-body">
        <div className="bookmarkSection">
            BOOKMARKS
        </div>
        </div>
    )
  }
}

export default BookmarkContainer;
